import React from 'react';
import { Route, Switch, Link } from 'react-router-dom';
import logo from '../images/__logo.svg';

function Header () {

  return (
    <header className='header'>
      <img 
        className='header__logo' 
        src={logo} 
        alt='логотип mesto russia'
      />
      <div className='header__authorization-container'>
        <Switch>
          <Route path='/sign-up'><Link to='sign-in'>Войти</Link></Route>
          <Route path='/sign-in'><Link to='sign-up'>Регистрация</Link></Route>
          <Route path='/'><p>Выход</p></Route>
        </Switch>
      </div>
    </header>
  );
}

export default Header;
